import React from 'react';
import '../assets/styles/Footer.css'

const Footer = () => {
    return (
        <>
            <div className="row">
                <div className="container ">
                    <div className="col-md-12 Footer">

                    </div>
                </div>
            </div>
        </>
    );
};

export default Footer;
